        /* CSS for div boxes */
        .box {
            border: 2px solid #000; /* Border style for the box */
            padding: 10px; /* Padding around the box */
            margin: 10px; /* Margin between boxes */
            display: inline-block; /* To make boxes display side by side */
            text-align: center; /* Center-align the content within the box */
        }

        /* CSS for image and button borders */
        img {
            border: 2px solid #000; /* Border style for the image */
        }

        .custom-button {
            border: 2px solid #000; /* Border style for the button */
            padding: 5px 10px; /* Add padding for the button */
            background-color: #0074D9; /* Change the button's background color */
            color: #fff; /* Change the button's text color */
            cursor: pointer; /* Add a pointer cursor for the button */
        }
  body {
            background: linear-gradient(45deg, #4CAF50, #2196F3);
            background-size: 500% 500%;
            animation: gradientAnimation 10s ease infinite;
        }

        @keyframes gradientAnimation {
            0% {
                background-position: 0% 50%;
            }
            50% {
                background-position: 100% 50%;
            }
            100% {
                background-position: 0% 50%;
            }

        }
